import React from "react";

import Card from "./../UI/Card" ;
import User from "./User" ;

const UsersList = (props) => {
  return (
    <Card>
      {props.people.map((user) => (
        <User name={user.name} age={us.age} />
      ))}
    </Card>
  );
};

export default UsersList;
